import { Component } from '@angular/core';
import { Input } from '@angular/core';

@Component({
  selector: 'app-button',
  templateUrl: './app-button.component.html',
  styleUrls: ['./app-button.component.css'],
  standalone: true,
})
export class AppButtonComponent {
  @Input({ required: true }) text!: string;
}
